import logo from './logo.svg';
import './App.css';
import WebForm from './Components/WebForm';

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <WebForm />
      </header>
    </div>
  );
}

export default App;
